import { TopNav,Footer} from "govuk-react";
import HomePage from "./Pages/HomePage";

import { Link, Route,Routes } from "react-router-dom";
import viewAppointment from "./Pages/viewAppointment";
function App() {
  return (
   <div>
    <TopNav>
<Link to="/" style={{color:"white" }}><TopNav.NavLink>HomePage</TopNav.NavLink></Link>
<Link to="/ViewAppointment" style={{color:"white" }}><TopNav.NavLink>View Admin viewAppointment</TopNav.NavLink></Link>
    </TopNav>


<Routes>
  <Route path="/" element={<HomePage/> }/>
  <Route path="/viewAppointment" element={ <viewAppointment /> }/>
</Routes>


    <Footer>

    </Footer>
  </div>
  );
}

export default App;
